export interface TimeSpan { 
    ticks?: number;
    days?: number;
    hours?: number;
    milliseconds?: number;
    minutes?: number;
    seconds?: number;
    readonly totalDays?: number;
    readonly totalHours?: number;
    readonly totalMilliseconds?: number;
    readonly totalMinutes?: number;
    readonly totalSeconds?: number;
}

import { TimeSpan } from './timeSpan';

export interface DownloadSettings { 
    wellboreUid?: string;
    logUid?: string;
    curveId?: string;
    utcTimeOffset?: TimeSpan;
    isRealtime?: boolean;
}

import { TaskMapping } from './taskMapping';

export interface MappingSettings { 
    mappings?: Array<TaskMapping>;
}

export interface TaskMapping { 
    wellUid?: string;
    wellboreUid?: string;
    companyId?: string;
    oilfieldName?: string;
    padName?: string;
    wellName?: string;
    wellboreName?: string;
}

export type TaskStatus = 'Created' | 'Queued' | 'InProgress' | 'Completed' | 'Failed';

export const TaskStatus = {
    Created: 'Created' as TaskStatus,
    Queued: 'Queued' as TaskStatus,
    InProgress: 'InProgress' as TaskStatus,
    Completed: 'Completed' as TaskStatus,
    Failed: 'Failed' as TaskStatus
};

import { DownloadSettings } from './downloadSettings';
import { MappingSettings } from './mappingSettings';
import { TaskStatus } from './taskStatus';

export interface UploadTask { 
    id?: string;
    name?: string;
    title?: string;
    readonly type?: string;
    deserializedId?: string;
    deserializedName?: string;
    deserializedTitle?: string;
    wellUid?: string;
    downloadSettings?: DownloadSettings;
    mappingSettings?: MappingSettings;
    status?: TaskStatus;
    statusMessage?: string;
    statusTimestamp?: Date;
}
